/**
 * GnosisSafe
 */

pragma solidity >=0.7.0 <0.9.0;
// GnosisSafe
import "./GnosisSafe.sol";

/** 
 * GnosisSafeL2
 * @title Gnosis Safe - A multisignature wallet with support for confirmations using signed messages based on ERC191.
 * @author Stefan George - <stefan@gnosis.io>
 * @author Richard Meissner - <richard@gnosis.io>
 */
abstract contract GnosisSafeL2 is GnosisSafe {

    // 
    // We combine nonce, sender and threshold into one to avoid stack too deep
    // Dev note: additionalInfo should not contain `bytes`, as this complicates decoding
    event SafeMultiSigTransaction(address to, uint256 value, bytes data, Enum.Operation operation, uint256 safeTxGas, uint256 baseGas, uint256 gasPrice, address gasToken, address payable refundReceiver, bytes signatures, bytes additionalInfo);
    event SafeModuleTransaction(address module, address to, uint256 value, bytes data, Enum.Operation operation);

    /**
     * 
     * @dev Allows to execute a Safe transaction confirmed by required number of owners and then pays the account that submitted the transaction.
     *      Note: The fees are always transferred, even if the user transaction fails.
     * @param to Destination address of Safe transaction.
     * @param value Ether value of Safe transaction.
     * @param data Data payload of Safe transaction.
     * @param operation Operation type of Safe transaction.
     * @param safeTxGas Gas that should be used for the Safe transaction.
     * @param baseGas Gas costs that are independent of the transaction execution(e.g. base transaction fee, signature check, payment of the refund)
     * @param gasPrice Gas price that should be used for the payment calculation.
     * @param gasToken Token address (or 0 if ETH) that is used for the payment.
     * @param refundReceiver Address of receiver of gas payment (or 0 if tx.origin).
     * @param signatures Packed signature data ({bytes32 r}{bytes32 s}{uint8 v})
     */
    function execTransaction(
        address to,
        uint256 value,
        bytes calldata data,
        Enum.Operation operation,
        uint256 safeTxGas,
        uint256 baseGas,
        uint256 gasPrice,
        address gasToken,
        address payable refundReceiver,
        bytes memory signatures
    ) public payable override returns (bool) {
        // 
        bytes memory additionalInfo;
        {
            additionalInfo = abi.encode(nonce, msg.sender, threshold);
        }
        // 
        emit SafeMultiSigTransaction(
            to,
            value,
            data,
            operation,
            safeTxGas,
            baseGas,
            gasPrice,
            gasToken,
            refundReceiver,
            signatures,
            additionalInfo
        );
        // 
        return super.execTransaction(to, value, data, operation, safeTxGas, baseGas, gasPrice, gasToken, refundReceiver, signatures);
    }

    /**
     * @dev Allows a Module to execute a Safe transaction without any further confirmations.
     * @param to Destination address of module transaction.
     * @param value Ether value of module transaction.
     * @param data Data payload of module transaction.
     * @param operation Operation type of module transaction.
     */
    function execTransactionFromModule(address to, uint256 value, bytes memory data, Enum.Operation operation) public override returns (bool success) {
        // 
        emit SafeModuleTransaction(msg.sender, to, value, data, operation);
        // 
        success = super.execTransactionFromModule(to, value, data, operation);
    }
}

